protected void checkMaxDoc(IndexCommit commit, int expectedMaxDoc) throws Exception {
  IndexReader reader = IndexReader.open(commit, true);
  try {
    assertEquals(expectedMaxDoc, reader.maxDoc());
  } finally {
    reader.close();
  }
}

